import React from 'react';
import { Link } from 'react-router-dom';
import * as faIcon from 'react-icons/fa';

const Navbar = () => {
    return (<>
        <div className="navbar">
            <Link to="#">
                <faIcon.FaBars />
            </Link>
        </div>
        <nav className={sidebar ? 'nav-menu active' : 'nav-menu'}></nav>
    </>);
}

export default Navbar;
